// frontend/src/pages/TutorDashboard.tsx
import { useEffect, useState } from 'react';
import axios from 'axios';

export default function TutorDashboard() {
  const [bookings, setBookings] = useState<any[]>([]);
  // const userId = localStorage.getItem('userId'); // ‡πÄ‡∏≠‡∏≤‡πÑ‡∏ß‡πâ‡πÉ‡∏ä‡πâ‡∏î‡∏∂‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏Ç‡∏≠‡∏á‡∏ï‡∏±‡∏ß‡πÄ‡∏≠‡∏á

  useEffect(() => {
    // TODO: ‡∏ï‡πâ‡∏≠‡∏á‡∏ó‡∏≥ API ‡∏ù‡∏±‡πà‡∏á Backend ‡πÉ‡∏´‡πâ‡∏£‡∏≠‡∏á‡∏£‡∏±‡∏ö‡∏Å‡∏≤‡∏£‡∏î‡∏∂‡∏á Booking ‡∏Ç‡∏≠‡∏á Tutor ‡∏Ñ‡∏ô‡∏ô‡∏±‡πâ‡∏ô‡πÜ
    // axios.get(`http://localhost:8080/api/bookings/tutor/${userId}`)...
  }, []);

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="container mx-auto p-6">
        <h1 className="text-3xl font-bold mb-8">‡πÅ‡∏ú‡∏á‡∏Ñ‡∏ß‡∏ö‡∏Ñ‡∏∏‡∏°‡∏ï‡∏¥‡∏ß‡πÄ‡∏ï‡∏≠‡∏£‡πå (Dashboard)</h1>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          
          {/* ‡∏™‡πà‡∏ß‡∏ô‡∏ó‡∏µ‡πà 1: ‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡πÄ‡∏ß‡∏•‡∏≤‡∏™‡∏≠‡∏ô (‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏Ñ‡∏≠‡∏£‡πå‡∏™/Slot) */}
          <div className="bg-white p-6 rounded-lg shadow">
            <h2 className="text-xl font-bold mb-4">üìÖ ‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏ï‡∏≤‡∏£‡∏≤‡∏á‡∏™‡∏≠‡∏ô / ‡πÄ‡∏ß‡∏•‡∏≤‡∏ß‡πà‡∏≤‡∏á</h2>
            <form className="space-y-4">
              <div>
                <label className="block text-sm font-medium">‡∏ß‡∏±‡∏ô‡∏ó‡∏µ‡πà‡πÄ‡∏£‡∏¥‡πà‡∏°‡∏ï‡πâ‡∏ô</label>
                <input type="datetime-local" className="border w-full p-2 rounded" />
              </div>
              <div>
                <label className="block text-sm font-medium">‡∏ß‡∏±‡∏ô‡∏ó‡∏µ‡πà‡∏™‡∏¥‡πâ‡∏ô‡∏™‡∏∏‡∏î</label>
                <input type="datetime-local" className="border w-full p-2 rounded" />
              </div>
              <button className="w-full bg-green-600 text-white py-2 rounded hover:bg-green-700">
                + ‡πÄ‡∏û‡∏¥‡πà‡∏°‡πÄ‡∏ß‡∏•‡∏≤‡∏ß‡πà‡∏≤‡∏á
              </button>
            </form>
          </div>

          {/* ‡∏™‡πà‡∏ß‡∏ô‡∏ó‡∏µ‡πà 2: ‡∏£‡∏≤‡∏¢‡∏Å‡∏≤‡∏£‡∏ó‡∏µ‡πà‡∏ô‡∏±‡∏Å‡πÄ‡∏£‡∏µ‡∏¢‡∏ô‡∏à‡∏≠‡∏á‡πÄ‡∏Ç‡πâ‡∏≤‡∏°‡∏≤ */}
          <div className="bg-white p-6 rounded-lg shadow">
            <h2 className="text-xl font-bold mb-4">student ‡∏ó‡∏µ‡πà‡∏à‡∏≠‡∏á‡πÄ‡∏Ç‡πâ‡∏≤‡∏°‡∏≤</h2>
            {bookings.length === 0 ? (
              <p className="text-gray-500">‡∏¢‡∏±‡∏á‡πÑ‡∏°‡πà‡∏°‡∏µ‡∏Å‡∏≤‡∏£‡∏à‡∏≠‡∏á‡πÄ‡∏Ç‡πâ‡∏≤‡∏°‡∏≤</p>
            ) : (
              <ul>
                {/* Loop bookings here */}
              </ul>
            )}
          </div>

        </div>
      </div>
    </div>
  );
}
